import { Breadcrumb } from 'antd';


const Bc = () => (
  <Breadcrumb>

    <Breadcrumb.Item >
      <a rel="noopener noreferrer" href="http://www.alipay.com/">

          General Journal
      </a>
    </Breadcrumb.Item>
  </Breadcrumb>
);

export default Bc;
